import React, { useState } from 'react';

const ProductList = () => {
  // Danh sách sản phẩm từ cửa hàng của bạn (có thể là một array hoặc data từ API)
  const products = [
    { id: 1, name: 'Sản phẩm 1', price: '100.000 VNĐ', description: 'Mô tả sản phẩm 1', image: `${process.env.PUBLIC_URL}/images/sanpham.jpeg` },
    { id: 2, name: 'Sản phẩm 2', price: '150.000 VNĐ', description: 'Mô tả sản phẩm 2', image: `${process.env.PUBLIC_URL}/images/sanpham.jpeg` },
    { id: 3, name: 'Sản phẩm 3', price: '200.000 VNĐ', description: 'Mô tả sản phẩm 3', image: `${process.env.PUBLIC_URL}/images/sanpham.jpeg` },
    // Thêm các sản phẩm khác vào đây
  ];

  const [selectedProduct, setSelectedProduct] = useState(null);

  // Hàm xử lý sự kiện khi người dùng bấm vào xem chi tiết sản phẩm
  const handleViewDetail = (product) => {
    setSelectedProduct(product);
    // Đoạn mã xử lý hiển thị thông tin chi tiết sản phẩm (có thể redirect đến một trang khác hoặc hiển thị modal)
    // Ví dụ: history.push(`/products/${product.id}`);
    // hoặc setShowDetailModal(true);
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>Sản Phẩm</h2>
      <div style={styles.productGrid}>
        {products.map(product => (
          <div key={product.id} style={styles.productCard}>
            <div style={styles.productImageContainer}>
              <img src={product.image} alt={product.name} style={styles.productImage} />
              <button style={styles.quickViewButton}>Quick View</button>
            </div>
            <div style={styles.productInfo}>
              <h3 style={styles.productTitle}>{product.name}</h3>
              <p style={styles.productPrice}>Giá: {product.price}</p>
              <p style={styles.productDescription}>{product.description}</p>
              <div style={styles.buttonContainer}>
                <button style={styles.productButton}>Thêm vào giỏ hàng</button>
                <button style={styles.viewDetailButton} onClick={() => handleViewDetail(product)}>Xem chi tiết</button>
              </div>
            </div>
          </div>
        ))}
      </div>
      {/* Hiển thị chi tiết sản phẩm */}
      {selectedProduct && (
        <div style={styles.productDetailContainer}>
          <h2>{selectedProduct.name}</h2>
          <p>{selectedProduct.description}</p>
          {/* Thêm các thông tin chi tiết sản phẩm khác tại đây */}
        </div>
      )}
    </div>
  );
}

const styles = {
  container: {
    maxWidth: '80%',
    margin: '0 auto',
    marginTop: '20px',
  },
  title: {
    fontSize: '2rem',
    color: '#333',
    marginBottom: '20px',
    textAlign: 'center',
  },
  productGrid: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fill, minmax(250px, 1fr))',
    gap: '20px',
  },
  productCard: {
    backgroundColor: '#fff',
    borderRadius: '10px',
    padding: '20px',
    transition: 'transform 0.3s ease',
    position: 'relative',
    overflow: 'hidden',
    boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.1)',
  },
  productImageContainer: {
    position: 'relative',
    overflow: 'hidden',
    borderRadius: '10px',
  },
  productImage: {
    width: '100%',
    height: 'auto',
    borderRadius: '10px',
    transition: 'transform 0.3s ease',
  },
  quickViewButton: {
    position: 'absolute',
    top: '10px',
    right: '10px',
    backgroundColor: 'rgba(0, 0, 0, 0.5)',
    color: '#fff',
    border: 'none',
    padding: '5px 10px',
    borderRadius: '5px',
    fontSize: '0.8rem',
    cursor: 'pointer',
    opacity: '0',
    transition: 'opacity 0.3s ease',
  },
  productInfo: {
    padding: '10px',
  },
  productTitle: {
    fontSize: '1.2rem',
    color: '#333',
    marginBottom: '10px',
  },
  productPrice: {
    fontSize: '1rem',
    color: '#666',
    marginBottom: '10px',
  },
  productDescription: {
    fontSize: '1rem',
    color: '#666',
    marginBottom: '10px',
  },
  buttonContainer: {
    display: 'flex',
    justifyContent:
    'space-between',
    marginTop: '10px',
  },
  productButton: {
    backgroundColor: '#326e51',
    color: '#fff',
    border: 'none',
    padding: '8px 16px',
    borderRadius: '20px',
    fontSize: '1rem',
    cursor: 'pointer',
    transition: 'background-color 0.3s ease',
  },
  viewDetailButton: {
    backgroundColor: '#333',
    color: '#fff',
    border: 'none',
    padding: '8px 16px',
    borderRadius: '20px',
    fontSize: '1rem',
    cursor: 'pointer',
    transition: 'background-color 0.3s ease',
  },
  productDetailContainer: {
    backgroundColor: '#f9f9f9',
    padding: '20px',
    marginTop: '20px',
    borderRadius: '10px',
  },
};

export default ProductList;
